INSERT INTO `review` (`id`, `customerid`, `review`, `status`) VALUES
(1, 18, 'A review is an evaluation of a publication, service, or company such as a movie (a movie review), video game (video game review), musical composition (music review of a composition or recording), book (book review); a piece of hardware like a car, home appliance, or computer; or an event or performance', 1),
(2, 18, 'A user review refers to a review written by a user or consumer for a product or a service based on her experience as a user of the reviewed product. Popular sources for consumer reviews are e-commerce sites like Amazon or Zappos, and social media sites like TripAdvisor and Yelp. E-commerce sites often have consumer reviews for products and sellers separately. Usually', 1),
(3, 18, 'A book review (or book report) is a form of criticism in which a book is analyzed based on content, style, and merit. It is often carried out in periodicals, as school work, or online. Its length may vary from a single paragraph to a substantial essay. In the case of a work of poetry or fiction, or of nonfiction in which the literary merits of the work are an important element, a review will commonly use the methods', 1),
(4, 22, 'Reviews of live music performances are typically short articles that tell readers about the performers or group(s) that were involved and the pieces or songs that were performed. The comments made by reviewers fall, roughly into two categories: technical comments and subjective/artistic comments. The elements in the \"technical\" category include rhythmic \"togetherness\", intonation, errors or slip-ups, and so on. These elements are fairly \"black and white\"; a pianist playing a concerto either played the right notes on a climactic scale run, or she missed it. The subjective comments refer to elements which are a matter of taste. The balance between the different elements in a review (information about the performer or group; information about the pieces/so', 0),
(5, 1, 'i liked your service', 1),
(6, 34, 'testing...', 0),
(7, 2, 'nice', 0),
